const OfferCard = ({ offer }) => {
  const [currentImageIndex, setCurrentImageIndex] = useState(0);
  const [isHovering, setIsHovering] = useState(false);

  useEffect(() => {
      let intervalId;

      if (isHovering) {
          intervalId = setInterval(() => {
              setCurrentImageIndex((prevIndex) => (prevIndex + 1) % offer.images.length);
          }, 1000); // Change image every 1 second
      }

      return () => {
          clearInterval(intervalId); };
  }, [isHovering, offer.images.length]);

  return (
      <div 
          className="offer-card" 
          onMouseEnter={() => setIsHovering(true)} 
          onMouseLeave={() => setIsHovering(false)}
      >
          <img src={offer.images[currentImageIndex]} alt={offer.title} className="offer-image" />
          <h3 className="offer-title">{offer.title}</h3>
          <p className="offer-description">{offer.description}</p>
          <div className="offer-rating">
              {Array.from({ length: offer.rating }, (_, i) => (
                  <span key={i} className="star"></span>
              ))}
          </div>
          <p className="offer-price">{offer.price}</p>
          <button className="offer-button">{offer.buttonText}</button>
      </div>
  )
}
